import React from 'react';


class Editwatchlist extends React.Component {
    render() {
        let watchlistElements = [];
        for (let i = 0; i <= 5; i++) {
            watchlistElements.push(<div id="watchedit">a</div>)
        }

        return(
            <div className="editwatch">
                {watchlistElements}
            </div>
        )
    }
}

export default Editwatchlist
